import React, { useState, useEffect } from 'react';
import '../style/SoundPage.css';

export default function MusicInsights() {
  const [audioFeatureRows, setAudioFeatureRows] = useState([]);
  const [filteredAudioFeatureRows, setFilteredAudioFeatureRows] = useState([]);
  const [error, setError] = useState("");
  const [rowsPerPage, setRowsPerPage] = useState(5);
  const [currentPage, setCurrentPage] = useState(1);

  // Input values for audio features
  const [instrumentalness, setInstrumentalness] = useState(0);
  const [energy, setEnergy] = useState(0);
  const [valence, setValence] = useState(0);
  const [liveness, setLiveness] = useState(0);
  const [acousticness, setAcousticness] = useState(0);

  const indexOfLastRow = currentPage * rowsPerPage;
  const indexOfFirstRow = indexOfLastRow - rowsPerPage;
  const paginatedRows = filteredAudioFeatureRows.slice(indexOfFirstRow, indexOfLastRow);

  const totalPages = Math.ceil(filteredAudioFeatureRows.length / rowsPerPage);

  const fetchSongsByAudioFeatures = async () => {
    try {
      const params = new URLSearchParams({
        instrumentalness,
        energy,
        valence,
        liveness,
        acousticness,
      }).toString();

      const response = await fetch(`http://localhost:8080/songs/audio-features?${params}`);
      if (!response.ok) throw new Error(`Failed to fetch audio features. Status: ${response.status}`);

      const data = await response.json();
      console.log("API Response Data: ", data); // Debugging log
      if (data.length === 0) {
        setError("No songs found matching the criteria.");
        setAudioFeatureRows([]);
        setFilteredAudioFeatureRows([]);
      } else {
        setAudioFeatureRows(data);
        setFilteredAudioFeatureRows(data);
        setError("");
      }
    } catch (err) {
      console.error(err);
      setError("Failed to load songs by audio features.");
      setAudioFeatureRows([]);
      setFilteredAudioFeatureRows([]);
    }
  };

  const handlePreviousPage = () => {
    if (currentPage > 1) {
      setCurrentPage((prevPage) => prevPage - 1);
    }
  };

  const handleNextPage = () => {
    if (currentPage < totalPages) {
      setCurrentPage((prevPage) => prevPage + 1);
    }
  };

  const handleRowsPerPageChange = (event) => {
    setRowsPerPage(parseInt(event.target.value, 10));
    setCurrentPage(1);
  };

  return (
    <>
      <div id="sound-page-wrapper">
        <div id="navbar">
          <ul>
            <li><a href="http://localhost:3000/">HomePage</a></li>
            <li><a href="http://localhost:3000/search">Search Page</a></li>
            <li><a href="http://localhost:3000/genre">Genre Page</a></li>
            <li><a href="http://localhost:3000/collaboration">Collaboration</a></li>
          </ul>
        </div>

        <h1>Track Explorer</h1>

        <div id="page-wrapper">
          <div id="content-wrapper">
            <div className="panel">
              <section className="table-section">
                <h2>Filter Songs by Audio Features</h2>
                <div className="controls">
                  <label>Instrumentalness: </label>
                  <input
                    type="number"
                    value={instrumentalness}
                    onChange={(e) => setInstrumentalness(e.target.value)}
                    step="0.01"
                    min="0"
                    max="1"
                  />
                  <label>Energy: </label>
                  <input
                    type="number"
                    value={energy}
                    onChange={(e) => setEnergy(e.target.value)}
                    step="0.01"
                    min="0"
                    max="1"
                  />
                  <label>Valence: </label>
                  <input
                    type="number"
                    value={valence}
                    onChange={(e) => setValence(e.target.value)}
                    step="0.01"
                    min="0"
                    max="1"
                  />
                  <label>Liveness: </label>
                  <input
                    type="number"
                    value={liveness}
                    onChange={(e) => setLiveness(e.target.value)}
                    step="0.01"
                    min="0"
                    max="1"
                  />
                  <label>Acousticness: </label>
                  <input
                    type="number"
                    value={acousticness}
                    onChange={(e) => setAcousticness(e.target.value)}
                    step="0.01"
                    min="0"
                    max="1"
                  />
                  <button onClick={fetchSongsByAudioFeatures}>Search</button>
                </div>

                {error ? (
                  <div className="error-message">{error}</div>
                ) : (
                  <>
                    <table className="data-table">
                      <thead>
                        <tr>
                          <th>Track Title</th>
                          <th>Instrumentalness</th>
                          <th>Energy</th>
                          <th>Valence</th>
                          <th>Liveness</th>
                          <th>Acousticness</th>
                        </tr>
                      </thead>
                      <tbody>
                        {paginatedRows.length > 0 ? (
                          paginatedRows.map((row, index) => (
                            <tr key={index}>
                              <td>{row.title || "Unknown Title"}</td>
                              <td>{row.instrumentalness?.toFixed(3) || "N/A"}</td>
                              <td>{row.energy?.toFixed(3) || "N/A"}</td>
                              <td>{row.valence?.toFixed(3) || "N/A"}</td>
                              <td>{row.liveness?.toFixed(3) || "N/A"}</td>
                              <td>{row.acousticness?.toFixed(3) || "N/A"}</td>
                            </tr>
                          ))
                        ) : (
                          <tr>
                            <td colSpan="6">No data available.</td>
                          </tr>
                        )}
                      </tbody>
                    </table>
                    <div className="pagination-controls">
                      <button disabled={currentPage === 1} onClick={handlePreviousPage}>
                        Previous
                      </button>
                      <span>
                        Page {currentPage} of {totalPages}
                      </span>
                      <button disabled={currentPage === totalPages} onClick={handleNextPage}>
                        Next
                      </button>
                    </div>
                  </>
                )}
              </section>
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
